import React from 'react'
import Room from './Room'

export default function Rooms(props) {
    return (
        <div>
            {props.rooms.map(r=>{
                return (
                    <Room 
                        name={r.name}
                        color={r.color}
                        type={r.type}
                        products={r.products}
                    />
                )
            })}
        </div>
    )
}
